import React, { Component } from "react";
import getImg from "../../Utils/getImg";
import "./Home.scss";

class Home extends Component() {
  constructor() {
    super(props);
    this.state = {
      userType: "",
      userName: "",
    };
  }

  render() {
    return (
      <>
        <div className="sa-header-w">
          <div className="sa-header-tabs-w">
            {window["detectMob"]() ? (
              <img
                src={getImg("MENU.svg")}
                onClick={() => this.props.setOpenMenu(!props.openMenu)}
              />
            ) : null}
          </div>
        </div>
      </>
    );
  }
}

export default Home;
